function initializeLoginEvent(){$("#login-form").on("submit",function(n){n.preventDefault();var t=$("input[name='handle']").val(),i=$("input[name='password']").val(),r={Handle:t,Password:i};ajax("POST",!0,"api/login",r,function(n){n.success?(setTokenCookie(n.token,1),window.location="/"):alert("Error with login. \n"+n.errors)})})}$(document).ready(function(){initializeLoginEvent()});